import React from 'react';
import Container from 'react-bootstrap/Container';
import { Row, Col } from 'react-bootstrap';
function Footer() {
    return (
        // <div id="footer-box">
        <Container fluid>
            <Row>
                <Col><img src="images/logo.svg" alt="logo" /></Col>
                <Col>Features</Col>
                <Col>Resources</Col>
                <Col>Company</Col>
            </Row>
        </Container>
        // </div>
    )
}
export default Footer;
